transforms.result:
@use 'mixins/mixins' as *;
@use 'mixins/var' as *;
@use 'common/var' as *;
@use 'common/transition';

@include b(collapse) {
  @include set-component-css-var('collapse', $collapse);

  border-top: 1px solid getCssVar('collapse-border-color');
  border-bottom: 1px solid getCssVar('collapse-border-color');
}

@include b(collapse-item) {
  @include when(disabled) {
    .#{$namespace}-collapse-item__header {
      color: getCssVar('text-color-disabled');
      cursor: not-allowed;
    }
  }
  @include e(header) {
    width: 100%;
    padding: 0;
    border: none;
    display: flex;
    align-items: center;
    height: getCssVar('collapse-header-height');
    line-height: getCssVar('collapse-header-height');
    background-color: getCssVar('collapse-header-bg-color');
    color: getCssVar('collapse-header-text-color');
    cursor: pointer;
    border-bottom: 1px solid getCssVar('collapse-border-color');
    font-size: getCssVar('collapse-header-font-size');
    font-weight: 500;
    transition: border-bottom-color getCssVar('transition-duration');
    outline: none;
    @include e(arrow) {
      margin: 0 8px 0 auto;
      transition: transform getCssVar('transition-duration');
      font-weight: 300;
      @include when(active) {
        transform: rotate(90deg);
      }
    }
    &.focusing:focus:not(:hover) {
      color: getCssVar('color-primary');
    }
    @include when(active) {
      border-bottom-color: transparent;
    }
  }

  @include e(wrap) {
    will-change: height;
    background-color: getCssVar('collapse-content-bg-color');
    overflow: hidden;
    box-sizing: border-box;
    border-bottom: 1px solid getCssVar('collapse-border-color');
  }

  @include e(content) {
    padding-bottom: 25px;
    font-size: getCssVar('collapse-content-font-size');
    color: getCssVar('collapse-content-text-color');
    line-height: 1.769230769230769;
  }

  &:last-child {
    margin-bottom: -1px;
  }
}

:root {
  --el-color-primary: #fff;
  --el-bg-color-overlay:transparent;
}

/* Element Chalk Variables */
.fade-in-linear-enter-active,.fade-in-linear-leave-active {
  transition: var(--el-transition-fade-linear);
}

.fade-in-linear-enter-from,.fade-in-linear-leave-to {
  opacity: 0;
}

.el-fade-in-linear-enter-active,.el-fade-in-linear-leave-active {
  transition: var(--el-transition-fade-linear);
}

.el-fade-in-linear-enter-from,.el-fade-in-linear-leave-to {
  opacity: 0;
}

.el-fade-in-enter-active,.el-fade-in-leave-active {
  transition: all var(--el-transition-duration) cubic-bezier(.55, 0, .1, 1);
}

.el-fade-in-enter-from,.el-fade-in-leave-active {
  opacity: 0;
}

.el-zoom-in-center-enter-active,.el-zoom-in-center-leave-active {
  transition: all var(--el-transition-duration) cubic-bezier(.55, 0, .1, 1);
}

.el-zoom-in-center-enter-from,.el-zoom-in-center-leave-active {
  opacity: 0;
  transform: scaleX(0);
}

.el-zoom-in-top-enter-active,.el-zoom-in-top-leave-active {
  opacity: 1;
  transform: scaleY(1);
  transform-origin: center top;
  transition: var(--el-transition-md-fade);
}
.el-zoom-in-top-enter-active[data-popper-placement^=top],.el-zoom-in-top-leave-active[data-popper-placement^=top] {
  transform-origin: center bottom;
}

.el-zoom-in-top-enter-from,.el-zoom-in-top-leave-active {
  opacity: 0;
  transform: scaleY(0);
}

.el-zoom-in-bottom-enter-active,.el-zoom-in-bottom-leave-active {
  opacity: 1;
  transform: scaleY(1);
  transform-origin: center bottom;
  transition: var(--el-transition-md-fade);
}

.el-zoom-in-bottom-enter-from,.el-zoom-in-bottom-leave-active {
  opacity: 0;
  transform: scaleY(0);
}

.el-zoom-in-left-enter-active,.el-zoom-in-left-leave-active {
  opacity: 1;
  transform: scale(1);
  transform-origin: top left;
  transition: var(--el-transition-md-fade);
}

.el-zoom-in-left-enter-from,.el-zoom-in-left-leave-active {
  opacity: 0;
  transform: scale(.45);
}

.collapse-transition {
  transition: var(--el-transition-duration) height ease-in-out, var(--el-transition-duration) padding-top ease-in-out, var(--el-transition-duration) padding-bottom ease-in-out;
}

.el-collapse-transition-enter-active,.el-collapse-transition-leave-active {
  transition: var(--el-transition-duration) max-height ease-in-out, var(--el-transition-duration) padding-top ease-in-out, var(--el-transition-duration) padding-bottom ease-in-out;
}

.horizontal-collapse-transition {
  transition: var(--el-transition-duration) width ease-in-out, var(--el-transition-duration) padding-left ease-in-out, var(--el-transition-duration) padding-right ease-in-out;
}

.el-list-enter-active,.el-list-leave-active {
  transition: all 1s;
}

.el-list-enter-from,.el-list-leave-to {
  opacity: 0;
  transform: translateY(-30px);
}

.el-list-leave-active {
  position: absolute !important;
}

.el-opacity-transition {
  transition: opacity var(--el-transition-duration) cubic-bezier(.55, 0, .1, 1);
}

.el-collapse {
  --el-collapse-border-color: var(--el-border-color-lighter);
  --el-collapse-header-height: 48px;
  --el-collapse-header-bg-color: var(--el-fill-color-blank);
  --el-collapse-header-text-color: var(--el-text-color-primary);
  --el-collapse-header-font-size: 13px;
  --el-collapse-content-bg-color: var(--el-fill-color-blank);
  --el-collapse-content-font-size: 13px;
  --el-collapse-content-text-color: var(--el-text-color-primary);
  border-bottom: 1px solid var(--el-collapse-border-color);
  border-top: 1px solid var(--el-collapse-border-color);
}

.el-collapse-item.is-disabled .el-collapse-item__header {
  color: var(--el-text-color-disabled);
  cursor: not-allowed;
}

.el-collapse-item__header {
  align-items: center;
  background-color: var(--el-collapse-header-bg-color);
  border: none;
  border-bottom: 1px solid var(--el-collapse-border-color);
  color: var(--el-collapse-header-text-color);
  cursor: pointer;
  display: flex;
  font-size: var(--el-collapse-header-font-size);
  font-weight: 500;
  height: var(--el-collapse-header-height);
  line-height: var(--el-collapse-header-height);
  outline: none;
  padding: 0;
  transition: border-bottom-color var(--el-transition-duration);
  width: 100%;
}
.el-collapse-item__arrow {
  font-weight: 300;
  margin: 0 8px 0 auto;
  transition: transform var(--el-transition-duration);
}
.el-collapse-item__arrow.is-active {
  transform: rotate(90deg);
}

.el-collapse-item__header.focusing:focus:not(:hover) {
  color: var(--el-color-primary);
}
.el-collapse-item__header.is-active {
  border-bottom-color: transparent;
}

.el-collapse-item__wrap {
  background-color: var(--el-collapse-content-bg-color);
  border-bottom: 1px solid var(--el-collapse-border-color);
  box-sizing: border-box;
  overflow: hidden;
  will-change: height;
}

.el-collapse-item__content {
  color: var(--el-collapse-content-text-color);
  font-size: var(--el-collapse-content-font-size);
  line-height: 1.7692307692;
  padding-bottom: 25px;
}

.el-collapse-item:last-child {
  margin-bottom: -1px;
}
